import React from "react";
import styled from "styled-components";
import {Link} from "react-router-dom";
import Icon from "../components/Icon";
const container = styled.div`
  height: 100%;
  width: 100%;
`
function tagsSettings(){
    return (
        <header>
            <Link to='../'>
                <Icon name='home'></Icon>
            </Link>
        </header>
    )
}
export default  tagsSettings;
